import React from 'react'
import './Preview.css'

class Preview extends React.Component {
    render () {
        return (
            <div className="Preview">
                <div className="bookmarkImage">
                    <img src="https://github.githubassets.com/images/modules/open_graph/github-logo.png" alt="url Img" />
                    {/* <img src={this.props.og.ogImage[0].url} alt="url Img" /> */}
                </div>
                <div className="bookmarkTitle">
                    {this.props.og.ogTitle}
                </div>
                <div className="bookmarkDes">
                    {this.props.og.ogDes}
                </div>
            </div>
        )
    }
}

export default Preview
